import videos from "../../Data/videos.json";
import "./nextVideo.scss";

function NextVideo() {
  return (
    <>
      <section className="next-video">
        <hr className="next-video__top-divider" />
        <div className="next-video__header">NEXT VIDEOS</div>

        {videos.map((el, i) => {
          <div className="next-video__card">
            <div className="next-video__image-container">
              <img className="next-video__image" src={el[i].image} alt="" />
            </div>
            <div className="next-video__info">
              <h4 className="next-video__title">{el[i].title}</h4>
              <p className="next-video__author">{el[i].channel}</p>
            </div>
          </div>;
        })}
      </section>
    </>
  );
}

export default NextVideo;
